import React from "react";
import { useSelector } from "react-redux";
// CSS
import "../common/common.css";
import "../fileConfiguration/fileConfig.css";
import "./branchRegistration.css"
// Components
import SidebarMain from "../common/SidebarMain";
import TerminalMainWindow from "./TerminalMainWindow";

const TerminalRegistration = () => {
  const company = useSelector((state) => {
    return state.sidebarReducer;
  });

  return (
    <div className="mainView w-100 d-flex">
      <SidebarMain />
      <div
        className={
          company.sidebarOpen
            ? "mainWindow configMainContent d-flex justify-content-between sidebarOpened"
            : "mainWindow configMainContent d-flex justify-content-between sidebarClosed"
        }
      >
        <TerminalMainWindow />
      </div>
    </div>
  );
};

export default TerminalRegistration;
